"use strict";function init(){email=$(".setup").data("email");redirectUrl=$(".setup").data("redirect");$(".timeOutMessage").hide();email!==undefined&&(isUserSiteReady(),setTimeout(timeOutCheck,6e4))}function timeOutCheck(){$(".setup-content > .timeOutMessage").slideDown(250)}function isUserSiteReady(){$.ajax({method:"POST",url:"/auth/isUserSiteReady",dataType:"json",data:{email:email},success:onSuccessCallBack,error:onErrorCallBack});setTimeout(isUserSiteReady,1e3)}function onSuccessCallBack(n){n.response==="true"&&n.statusCode===200&&(redirectUrl!==undefined?window.location.href=redirectUrl:console.log("Failed to redirect. Redirect URL not set."));console.log(n)}function onErrorCallBack(n,t,i){console.log(t+": "+i)}var email,redirectUrl,businessUnitName;$(document).ready(init);